<main>
	<style src="./app.css"></style>
	<style>
		body{
			!background-color: rgb(43 46 64)
		}
	</style>
	<img src="data:image/png;base64,"
	 alt="meteorite" class="embed-responsive-item" style="max-width: 30rem; max-height: 30rem">
	
    <div class="flex justify-center items-center text-white">
    <h2 id="text">Please Wait.</h2>
  </div>

    <div class="flex justify-center items-center">
      <progress class="progress w-70 progress-primary "></progress>
    </div>
</main>

<script lang="ts">
		 import { getMatches } from '@tauri-apps/api/cli';
	 import { message } from '@tauri-apps/api/dialog';
	 import { invoke } from '@tauri-apps/api/tauri';
	 import { exit } from '@tauri-apps/api/process';
     import { dataDir } from '@tauri-apps/api/path';
	 import { fetch } from '@tauri-apps/api/http';
	 import { platform } from '@tauri-apps/api/os';
	async function main() {
	const platformName = await platform();
	const matches = await getMatches();
       if (matches.args.first.value === false){
        // launched without args
        //message("Join on website please.", "Info");
        //exit(1);
       }
       var url_to_open = matches.args.first.value[1]
       url_to_open = url_to_open?.replace("meteorite-launch://","")
      url_to_open = url_to_open?.replace('/',"")
      url_to_open = url_to_open?.split('[') // this will turn it into a array
	  // url to open array
	  // 0 = placeid to open
	  // 1 = auth token
	  // 2 = version to open
	  // 3 = studio or player
	  
	  let dataDirPath = await dataDir();

	  if (url_to_open[3] === "studio"){
		dataDirPath = dataDirPath + "MeteoritePlayerStudio" +url_to_open[2]
		const exists = await invoke('exists', { path: dataDirPath+'/RobloxStudioBeta.exe'});
		if (exists === true){
			const hash = await fetch('http://mete0r.xyz/assets/hashstudio'+url_to_open[2]+'.txt', {
  			method: 'GET',
 			 timeout: 30,
			 responseType: 2
			});
	const currenthash = await invoke('hash', {path: dataDirPath+'/RobloxStudioBeta.exe'});
	if (hash.data === currenthash){
		//updated
		//launch
		// rust doesn't like \ for some reason so quick hack
		if (platformName === "linux"){
		dataDirPath = "wine "+dataDirPath
	  	}
		await invoke('exec', {exe:dataDirPath.replace(/\\/g, '/')+"/RobloxStudioBeta.exe"});
		exit(1);
	}
		}

	  // download and extract if it isn't already installed or update
	  document.getElementById('text').innerHTML = "Downloading"
      await invoke('download_file', { url: 'http://mete0r.xyz/assets/releasestudio'+url_to_open[2]+'.zip',path: dataDirPath+'releasestudio'+url_to_open[2]+'.zip'});
	  document.getElementById('text').innerHTML = "Extracting"
	  await invoke('extract', { path: dataDirPath+'releasestudio'+url_to_open[2]+'.zip',extracto: dataDirPath});
	  document.getElementById('text').innerHTML = "Done!"
	  const releaseexists = await invoke('exists', { path: dataDirPath+'releasestudio'+url_to_open[2]+'.zip'});
	  if (releaseexists === true){
		await invoke('removefile', {file:dataDirPath+'releasestudio'+url_to_open[2]+'.zip'});
	  }
	  if (platformName === "linux"){
		dataDirPath = "wine "+dataDirPath
	  	}
	  await invoke('exec', {exe:dataDirPath.replace(/\\/g, '/')+"/RobloxStudioBeta.exe"});
	  exit(1);

	  }
	  
	  
	   if (url_to_open[2] != "2016"){
		dataDirPath = dataDirPath + "MeteoritePlayer" +url_to_open[2]
		// legacy version
		const exists = await invoke('exists', { path: dataDirPath+'/RobloxPlayerBeta.exe'});
		if (exists === true){
		// meteorite already installed
		const hash = await fetch('http://mete0r.xyz/assets/hash'+url_to_open[2]+'.txt', {
  			method: 'GET',
 			 timeout: 30,
			 responseType: 2
			});
	const currenthash = await invoke('hash', {path: dataDirPath+'/RobloxPlayerBeta.exe'});
	if (hash.data === currenthash){
		//updated
		//launch
		// rust doesn't like \ for some reason so quick hack
		if (platformName === "linux"){
		dataDirPath = "wine "+dataDirPath
	  	}
		await invoke('exec', {exe:dataDirPath.replace(/\\/g, '/')+"/RobloxPlayerBeta.exe -a \"http://www.mete0r.xyz/\" -j \"http://www.mete0r.xyz/game/"+url_to_open[2]+"/join?placeid="+url_to_open[0]+"&auth="+url_to_open[1]+"\" -t \"ticket\""});
		exit(1);
	}



	  }
	  // download and extract if it isn't already installed or update
	  document.getElementById('text').innerHTML = "Downloading"
      await invoke('download_file', { url: 'http://mete0r.xyz/assets/release'+url_to_open[2]+'.zip',path: dataDirPath+'release'+url_to_open[2]+'.zip'});
	  document.getElementById('text').innerHTML = "Extracting"
	  await invoke('extract', { path: dataDirPath+'release'+url_to_open[2]+'.zip',extracto: dataDirPath});
	  document.getElementById('text').innerHTML = "Done!"
	  const releaseexists = await invoke('exists', { path: dataDirPath+'release'+url_to_open[2]+'.zip'});
	  if (releaseexists === true){
		await invoke('removefile', {file:dataDirPath+'release'+url_to_open[2]+'.zip'});
	  }
	  if (platformName === "linux"){
		dataDirPath = "wine "+dataDirPath
	  }
	  await invoke('exec', {exe:dataDirPath.replace(/\\/g, '/')+"/RobloxPlayerBeta.exe -a \"http://www.mete0r.xyz/\" -j \"http://www.mete0r.xyz/game/"+url_to_open[2]+"/join?placeid="+url_to_open[0]+"&auth="+url_to_open[1]+"\" -t \"ticket\""});
	  exit(1);

	   }


	   const exists = await invoke('exists', { path: dataDirPath+'MeteoritePlayer/RobloxPlayerBetaRaw.exe'});
	  if (exists === true){
		// meteorite already installed
		const hash = await fetch('http://mete0r.xyz/assets/hash.txt', {
  			method: 'GET',
 			 timeout: 30,
			 responseType: 2
			});
	const currenthash = await invoke('hash', {path: dataDirPath+'MeteoritePlayer/RobloxPlayerBetaRaw.exe'});
	if (hash.data === currenthash){
		//updated
		//launch
		// rust doesn't like \ for some reason so quick hack
		if (platformName === "linux"){
		dataDirPath = "wine "+dataDirPath
	  	}
		await invoke('exec', {exe:dataDirPath.replace(/\\/g, '/')+"MeteoritePlayer/RobloxPlayerBetaRaw.exe -a \"mete0r.xyz/login/Negotiate\" -j \"http://mete0r.xyz/game/placelauncher?name="+url_to_open[0]+"&auth="+url_to_open[1]+"\" -t \"ticket\""});
		exit(1);
	}



	  }
	  // download and extract if it isn't already installed or update
	  document.getElementById('text').innerHTML = "Downloading"
      await invoke('download_file', { url: 'http://mete0r.xyz/assets/release.zip',path: dataDirPath+'release.zip'});
	  document.getElementById('text').innerHTML = "Extracting"
	  await invoke('extract', { path: dataDirPath+'release.zip',extracto: dataDirPath+'MeteoritePlayer'});
	  document.getElementById('text').innerHTML = "Done!"
	  const releaseexists = await invoke('exists', { path: dataDirPath+'release.zip'});
	  if (releaseexists === true){
		await invoke('removefile', {file:dataDirPath+'release.zip'});
	  }
	  if (platformName === "linux"){
		dataDirPath = "wine "+dataDirPath
	  	}
	  await invoke('exec', {exe:dataDirPath.replace(/\\/g, '/')+"MeteoritePlayer/RobloxPlayerBetaRaw.exe -a \"mete0r.xyz/login/Negotiate\" -j \"http://mete0r.xyz/game/placelauncher?name="+url_to_open[0]+"&auth="+url_to_open[1]+"\" -t \"ticket\""});
	  exit(1);
}
main()
</script>

